import React from 'react';


const Schools = ({ schoolData }) => {

    return (
        <div>
            <div className="school-portfolio">
                <h3>학력</h3>
                {
                    Array.from(schoolData).map(school => {
                        return (
                            <div key={`school_${school.id}`}>
                                <p>{school.name}</p>
                                <p>{school.major}</p>
                                <p>{school.status}</p>
                            </div>
                        )
                    })
                }
            </div>
        </div>
    );
    
}

export default Schools;
